import React from 'react'
import { useParams } from 'react-router-dom'
import axiosInstance from '../../baseurl'

function ViewPrograms() {
    const {id} = useParams()

    axiosInstance.post(`/`)
    .then((res)=>{
        console.log(res);
    })
    .catch((err)=>{
        console.log(err);
    })
  return (
    <div>ViewPrograms</div>
  )
}

export default ViewPrograms
